CREATE SCHEMA IF NOT EXISTS EXAMPLE;

CREATE TABLE EXAMPLE.ADDRESS(
	ADDRESSID INT NOT NULL,
	ADDRESSLINE1 VARCHAR(128) NOT NULL,
	ADDRESSLINE2 VARCHAR(128) NULL,
	CITY VARCHAR(128) NOT NULL,
	STATEPROVINCE VARCHAR(128) NOT NULL,
	COUNTRYREGION VARCHAR(128) NOT NULL,
	POSTALCODE VARCHAR(15) NOT NULL,
	MODIFIEDDATE DATETIME NOT NULL
);

CREATE TABLE EXAMPLE.CUSTOMER(
	CUSTOMERID INT NOT NULL,
	TITLE VARCHAR(8) NULL,
	FIRSTNAME VARCHAR(128) NOT NULL,
	MIDDLENAME VARCHAR(128) NULL,
	LASTNAME VARCHAR(128) NOT NULL,
	SUFFIX VARCHAR(10) NULL,
	COMPANYNAME VARCHAR(128) NULL,
	SALESPERSON VARCHAR(256) NULL,
	EMAILADDRESS VARCHAR(50) NULL,
	PHONE VARCHAR(32) NULL,
	PASSWORDHASH VARCHAR(128) NOT NULL,
	PASSWORDSALT VARCHAR(10) NOT NULL,
	MODIFIEDDATE DATETIME NOT NULL
);

CREATE TABLE EXAMPLE.CUSTOMERADDRESS(
	CUSTOMERID INT NOT NULL,
	ADDRESSID INT NOT NULL,
	ADDRESSTYPE VARCHAR(128) NOT NULL,
	MODIFIEDDATE DATETIME NOT NULL
);




